  "One to one description": "\u0418\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u0435\u0442\u0441\u044F \u0434\u043B\u044F \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u044F \u043E\u0442\u043D\u043E\u0448\u0435\u043D\u0438\u0439 \u043E\u0434\u0438\u043D \u043A \u043E\u0434\u043D\u043E\u043C\u0443. \u041D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u0443 \u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044F \u0435\u0441\u0442\u044C \u043F\u0440\u043E\u0444\u0438\u043B\u044C.",
  "One to many description": "\u0418\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u0435\u0442\u0441\u044F \u0434\u043B\u044F \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u044F \u043E\u0442\u043D\u043E\u0448\u0435\u043D\u0438\u044F \xAB\u043E\u0434\u0438\u043D \u043A\u043E \u043C\u043D\u043E\u0433\u0438\u043C\xBB. \u041D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u0432 \u0441\u0442\u0440\u0430\u043D\u0435 \u043C\u043E\u0436\u0435\u0442 \u0431\u044B\u0442\u044C \u043C\u043D\u043E\u0433\u043E \u0433\u043E\u0440\u043E\u0434\u043E\u0432, \u0430 \u0433\u043E\u0440\u043E\u0434 \u043C\u043E\u0436\u0435\u0442 \u043D\u0430\u0445\u043E\u0434\u0438\u0442\u044C\u0441\u044F \u0442\u043E\u043B\u044C\u043A\u043E \u0432 \u043E\u0434\u043D\u043E\u0439 \u0441\u0442\u0440\u0430\u043D\u0435. \u041A\u043E\u0433\u0434\u0430 \u043E\u043D \u043F\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442 \u0432 \u0432\u0438\u0434\u0435 \u043F\u043E\u043B\u044F, \u044D\u0442\u043E \u043F\u043E\u0434\u0442\u0430\u0431\u043B\u0438\u0446\u0430, \u0432 \u043A\u043E\u0442\u043E\u0440\u043E\u0439 \u043E\u0442\u043E\u0431\u0440\u0430\u0436\u0430\u044E\u0442\u0441\u044F \u0437\u0430\u043F\u0438\u0441\u0438 \u0441\u0432\u044F\u0437\u0430\u043D\u043D\u043E\u0439 \u043A\u043E\u043B\u043B\u0435\u043A\u0446\u0438\u0438. \u041F\u0440\u0438 \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0438 \u043F\u043E\u043B\u0435 \xAB\u043C\u043D\u043E\u0433\u0438\u0435 \u043A \u043E\u0434\u043D\u043E\u043C\u0443\xBB \u0430\u0432\u0442\u043E\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438 \u0441\u043E\u0437\u0434\u0430\u0435\u0442\u0441\u044F \u0432 \u0441\u0432\u044F\u0437\u0430\u043D\u043D\u043E\u0439 \u043A\u043E\u043B\u043B\u0435\u043A\u0446\u0438\u0438.",
  "Many to one description": "\u0418\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u0435\u0442\u0441\u044F \u0434\u043B\u044F \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u044F \u043E\u0442\u043D\u043E\u0448\u0435\u043D\u0438\u0439 \xAB\u043C\u043D\u043E\u0433\u0438\u0435 \u043A \u043E\u0434\u043D\u043E\u043C\u0443\xBB. \u041D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u0433\u043E\u0440\u043E\u0434 \u043C\u043E\u0436\u0435\u0442 \u043F\u0440\u0438\u043D\u0430\u0434\u043B\u0435\u0436\u0430\u0442\u044C \u0442\u043E\u043B\u044C\u043A\u043E \u043E\u0434\u043D\u043E\u0439 \u0441\u0442\u0440\u0430\u043D\u0435, \u0430 \u0432 \u0441\u0442\u0440\u0430\u043D\u0435 \u043C\u043E\u0436\u0435\u0442 \u0431\u044B\u0442\u044C \u043C\u043D\u043E\u0433\u043E \u0433\u043E\u0440\u043E\u0434\u043E\u0432. \u041A\u043E\u0433\u0434\u0430 \u043E\u043D \u043F\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442 \u0432 \u0432\u0438\u0434\u0435 \u043F\u043E\u043B\u044F, \u044D\u0442\u043E \u0440\u0430\u0441\u043A\u0440\u044B\u0432\u0430\u044E\u0449\u0438\u0439\u0441\u044F \u0441\u043F\u0438\u0441\u043E\u043A, \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u0435\u043C\u044B\u0439 \u0434\u043B\u044F \u0432\u044B\u0431\u043E\u0440\u0430 \u0437\u0430\u043F\u0438\u0441\u0438 \u0438\u0437 \u0441\u0432\u044F\u0437\u0430\u043D\u043D\u043E\u0439 \u043A\u043E\u043B\u043B\u0435\u043A\u0446\u0438\u0438. \u041F\u043E\u0441\u043B\u0435 \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u044F \u043F\u043E\u043B\u0435 \xAB\u043E\u0434\u0438\u043D \u043A\u043E \u043C\u043D\u043E\u0433\u0438\u043C\xBB \u0430\u0432\u0442\u043E\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438 \u0441\u043E\u0437\u0434\u0430\u0435\u0442\u0441\u044F \u0432 \u0441\u0432\u044F\u0437\u0430\u043D\u043D\u043E\u0439 \u043A\u043E\u043B\u043B\u0435\u043A\u0446\u0438\u0438.",
  "Many to many description": "\u0418\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u0435\u0442\u0441\u044F \u0434\u043B\u044F \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u044F \u043E\u0442\u043D\u043E\u0448\u0435\u043D\u0438\u0439 \xAB\u043C\u043D\u043E\u0433\u0438\u0435 \u043A\u043E \u043C\u043D\u043E\u0433\u0438\u043C\xBB. \u041D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u0443 \u0443\u0447\u0435\u043D\u0438\u043A\u0430 \u0431\u0443\u0434\u0435\u0442 \u043C\u043D\u043E\u0433\u043E \u0443\u0447\u0438\u0442\u0435\u043B\u0435\u0439, \u0430 \u0443 \u0443\u0447\u0438\u0442\u0435\u043B\u044F \u0431\u0443\u0434\u0435\u0442 \u043C\u043D\u043E\u0433\u043E \u0443\u0447\u0435\u043D\u0438\u043A\u043E\u0432. \u041A\u043E\u0433\u0434\u0430 \u043E\u043D \u043F\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442 \u0432 \u0432\u0438\u0434\u0435 \u043F\u043E\u043B\u044F, \u044D\u0442\u043E \u0440\u0430\u0441\u043A\u0440\u044B\u0432\u0430\u044E\u0449\u0438\u0439\u0441\u044F \u0441\u043F\u0438\u0441\u043E\u043A, \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u0435\u043C\u044B\u0439 \u0434\u043B\u044F \u0432\u044B\u0431\u043E\u0440\u0430 \u0437\u0430\u043F\u0438\u0441\u0435\u0439 \u0438\u0437 \u0441\u0432\u044F\u0437\u0430\u043D\u043D\u043E\u0439 \u043A\u043E\u043B\u043B\u0435\u043A\u0446\u0438\u0438.",
